import React from 'react'

class MainContent extends React.Component {
  constructor() {
    super()
  }

  render() {
    return (
      <div id="body">
        <div class='row'>
          <div class='column'>
            <div class='sidebar'>
              5050 Soquel Dr, Soquel
                California, 95073

            </div>
          </div>
          <div class='column'>
            <div class='content'>
              Some Text in Column Two
            </div>
          </div>
        </div>
      </div>
    )
  }
}

export default MainContent
